import React from "react"
import "./VerticalProgressBar.css"

function VerticalProgressBar(props) {
  const { totalExperience, workExperience } = props

  const containerStyle = {
    height: `${totalExperience}px`,
  }

  const progressStyle = {
    height: `${workExperience}px`,
  }

  return (
    <div className="vertical-progress-bar-container" style={containerStyle}>
      <div
        className="vertical-progress-bar-progress"
        style={progressStyle}
      ></div>
    </div>
  )
}

export default VerticalProgressBar
